import Ecdata from "./Ecdata";

import { BrowserRouter as Router,Routes,Route } from "react-router-dom";
function Erouter(){
    return(
        <div>
            <Router>
                <Routes>
                <Route path="/ecdata" element={<Ecdata/>}/>
                    
    
                     </Routes>
            </Router>

        </div>
    )
}
export default Erouter;
